import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
const Styles = styled.div`
  .main-special {
    position: relative;
    height: 36vh;
    width: 100%;
    background: #567786;
    cursor: pointer;
    overflow: hidden;
    // padding-top: 2%;
    // padding-bottom: 2%;
  }
  .header {
  }
  .textContainer {
    justify-content: center;
    padding-top: 5%;
    padding-bottom: 5%;
  }
  .text {
    font-family: "Open Sans";
  }
`;

const Banner = () => {

  return (
      <Fragment>

    <Styles> 
   <div className="header"> 
   <Container 
   fluid 
   style={{width:"100%", padding:"0",background:"red"}}> 
    {/* <img src={bannerpic1} alt="React Logo"  /> */}


    <Row className="justify-content-md-center">


       <h1> Banner </h1> 

       </Row>
  </Container>
   </div>
   </Styles> 

   </Fragment>
  );
};

export default Banner;
